		case 6:	$word = authorName();	break;
		case 7:	$word = authorName();	break;
		case 8:	$word = authorName();	break;
		case 9:	$word = authorName();	break;
		case 10:$word = wolfName(1);	break;
		case 11:$word = catName(any);	break;
	}
	$word = strrev(strtolower($word));
