function ConanName($type,$gender)
{
	if ($type == "none")
	{
		switch (mt_rand(0,2))
		{
			case 0: $type = "Aquilonian";	break;
			case 1: $type = "Cimmerian";	break;
			case 2: $type = "Stygian";		break;
		}
	}
	$lpart = ConanLast($type,$gender);
	if (strlen($lpart) < 3){ $limit = 1; } else { $limit = 0; }
	$fpart = ConanFirst($type,$gender,$limit);
	$name = $fpart . $lpart;
	if (mt_rand(1,20) == 1){ $name = ConanPlain($type,$gender); }
	return $name;
}

