function manyName()
{
	switch (mt_rand(0,17))
	{
		case 0: $word = mageName();			break;
		case 1: $word = demonName();		break;
		case 2:	$word = elfName();			break;
		case 3:	$word = impName();			break;
		case 4:	$word = lizardmanName();	break;
		case 5:	$word = ratmanName();		break;
		case 6:	$word = orcName();			break;
		case 7:	$word = goblinName();		break;
		case 8:	$word = FemaleName();		break;
		case 9:	$word = MaleName();			break;
		case 10:$word = humanFemaleName();	break;
		case 11:$word = humanMaleName();	break;
		case 12:$word = genericName();		break;
		case 13:$word = gnomeName();		break;
		case 14:$word = dwarfName();		break;
		case 15:$word = dragonName();		break;
		case 16:$word = wolfName(1);		break;
		case 17:$word = catName(any);		break;
	}
	return $word;
}

